import { useState, useEffect } from 'react'
import { Route } from 'react-router-dom'

import axios from 'axios'

export default function DogGif () {
        let [dog, updateDog] = useState([])

        const apiCall = async () => {
            const data = await axios(`https://api.thedogapi.com/v1/images/search?mime_types=gif&api_key=${process.env.REACT_APP_API_KEY_DOG}`)
            console.log(data.data[0].url)
            updateDog(data.data[0].url)
            }

        useEffect(() => {
            apiCall()
        }, [])


    return (<>
        <button onClick={apiCall}>Random GIF</button>
        <div className="dog-image-gif"><img src={dog} alt="dog-gif"></img></div>
    </>)
}
